Un "if" en Java es una estructura de control de flujo que permite ejecutar un bloque de código si se cumple una condición determinada. La sintaxis básica de un "if" en Java es la siguiente:

```java
if (condición) {
    // código a ejecutar si la condición es verdadera
}
```

Donde "condición" es una expresión que devuelve un valor booleano (true o false). Si la condición es verdadera, se ejecuta el código dentro del bloque.

Por ejemplo:

```java
int edad = 25;
if (edad >= 18) {
    System.out.println("Eres mayor de edad");
}
```

En este ejemplo, si la variable "edad" es mayor o igual a 18, se imprime "Eres mayor de edad".

También se puede utilizar el "if" con un bloque de código que se ejecuta si la condición es falsa, utilizando la palabra reservada "else":

```java
int edad = 15;
if (edad >= 18) {
    System.out.println("Eres mayor de edad");
} else {
    System.out.println("Eres menor de edad");
}
```

En este caso, si la variable "edad" es menor que 18, se imprime "Eres menor de edad".

También se pueden utilizar múltiples condiciones con el "if" utilizando la palabra reservada "else if":

```java
int edad = 25;
if (edad < 18) {
    System.out.println("Eres menor de edad");
} else if (edad < 65) {
    System.out.println("Eres adulto");
} else {
    System.out.println("Eres mayor de edad");
}
```

En este ejemplo, se comprueba la condición de cada "else if" hasta que se encuentre una que sea verdadera.

