### Prime Number Checker Function in JavaScript

Here's a simple function in JavaScript that checks if any of the numbers in the input array are prime numbers.

```javascript
/**
 * Checks if a number is prime.
 * @param {number} num - The number to check.
 * @returns {boolean} True if the number is prime, false otherwise.
 */
function isPrime(num) {
    if (num <= 1) return false;
    for (let i = 2; i <= Math.sqrt(num); i++) {
        if (num % i === 0) return false;
    }
    return true;
}

/**
 * Checks if any of the numbers in the input array are prime numbers.
 * @param {number[]} numbers - The array of numbers to check.
 */
function checkPrimeNumbers(numbers) {
    if (!Array.isArray(numbers) || numbers.length!== 5) {
        throw new Error('Input must be an array of 5 numbers');
    }

    numbers.forEach(num => {
        if (typeof num!== 'number' || isNaN(num)) {
            throw new Error('All elements in the array must be numbers');
        }
    });

    numbers.forEach(num => {
        if (isPrime(num)) {
            console.log(`The number ${num} is a prime number.`);
        }
    });
}

// Example usage:
const numbers = [2, 4, 6, 7, 9];
checkPrimeNumbers(numbers);
```

This function `checkPrimeNumbers` first checks if the input is an array of 5 numbers. It then iterates over each number in the array, checks if it's a prime number using the `isPrime` function, and prints the number to the console if it is prime.

Un bucle for en Java se utiliza para ejecutar un bloque de código repetidamente mientras se cumpla una condición determinada. Hay dos tipos de bucles for en Java: for tradicional y for-each.

**Bucle for tradicional**

El bucle for tradicional se utiliza para iterar sobre un rango de números enteros. La sintaxis es la siguiente:

```java
for (inicialización; condición; actualización) {
    // código a ejecutar
}
```

Donde:

*   `inicialización` es la variable que se utiliza para almacenar el valor inicial del bucle.
*   `condición` es la condición que se debe cumplir para que el bucle se ejecute.
*   `actualización` es la operación que se realiza después de cada iteración.

Ejemplo:

```java
for (int i = 0; i < 5; i++) {
    System.out.println("Iteración " + i);
}
```

Este bucle imprimirá los números del 0 al 4.

**Bucle for-each**

El bucle for-each se utiliza para iterar sobre una colección de elementos. La sintaxis es la siguiente:

```java
for (tipoDeElemento elemento : colección) {
    // código a ejecutar
}
```

Donde:

*   `tipoDeElemento` es el tipo de elemento que se encuentra en la colección.
*   `elemento` es la variable que se utiliza para almacenar el elemento actual.
*   `colección` es la colección que se está iterando.

Ejemplo:

```java
String[] colores = {"rojo", "verde", "azul"};
for (String color : colores) {
    System.out.println(color);
}
```

Este bucle imprimirá los colores de la lista.

**Bucle for-each con índice**

Si necesitas acceder al índice del elemento actual, puedes utilizar la siguiente sintaxis:

```java
for (int índice = 0; índice < colección.size(); índice++) {
    tipoDeElemento elemento = colección.get(índice);
    // código a ejecutar
}
```

Ejemplo:

```java
String[] colores = {"rojo", "verde", "azul"};
for (int i = 0; i < colores.length; i++) {
    System.out.println("Índice: " + i + ", Color: " + colores[i]);
}
```

Este bucle imprimirá los colores de la lista con su respectivo índice.
